import { Switch, Router, Route } from "react-router";
import App from "./App";
import Home from "./pages/Home";


function Routes() {
  return(
      <>
        <Router>
            <Switch>
                <Route exact path="/home" component={App} />
            </Switch>
        </Router>
      </>
  );
}

export default Routes;
